const CheckoutPage = () => {
      

  return(
     <div className="checkout-page-row">
       <div className="checkout-page-column-left">
         <ClientCheckout />
       </div>
       <div className="checkout-page-column-right"> 
          <CheckoutSummary/>
       </div> 
     </div>
     )
};


export default CheckoutPage;


